void titlebar_init(int default_window_pos_x, int default_window_pos_y, ImGuiIO& io) {
	ImVector<ImWchar> ranges;
	ImFontGlyphRangesBuilder builder;
	builder.AddChar(0x25a1);
	builder.AddChar(0x2610);
	builder.AddChar(0x2573);
	builder.AddChar(0x2715);
	builder.AddChar(0x2014);   // minimize
	builder.AddRanges(io.Fonts->GetGlyphRangesDefault()); // Add one of the default ranges
	builder.BuildRanges(&ranges);                          // Build the final result (ordered ranges with all the unique characters submitted)
	ImFont* SourceCodePro = io.Fonts->AddFontFromMemoryCompressedTTF(SCPRO_compressed_data, SCPRO_compressed_size, 18.0f, NULL, ranges.Data);
	ImFont* SourceCodePro2 = io.Fonts->AddFontFromMemoryCompressedTTF(SCPRO_compressed_data, SCPRO_compressed_size, 22.0f, NULL, ranges.Data);
	io.Fonts->Build();                                     // Build the atlas while 'ranges' is still in scope and not deleted.

	temp_window_x = default_window_pos_x;
	temp_window_y = default_window_pos_y;
}

void titlebar(HWND hwnd, ImGuiIO& io, int titlebar_height, ImGuiViewport* viewport, bool minimize, bool maximize, bool close) {
	static ImGuiWindowFlags titlebar_flags =
		ImGuiWindowFlags_NoTitleBar | ImGuiWindowFlags_NoCollapse
		| ImGuiWindowFlags_NoResize | ImGuiWindowFlags_NoMove
		| ImGuiWindowFlags_NoScrollbar
		| ImGuiWindowFlags_NoSavedSettings | ImGuiWindowFlags_NoScrollWithMouse;
	int end_width = 0;
	if (minimize)
		end_width += 32;
	if (maximize)
		end_width += 32;
	if (close)
		end_width += 32;
	// check if mouse cursor is inside the titlebar area & compensate 7px padding: is used for the window border resize
	if ((io.MousePos.x >= 7 && io.MousePos.x <= (viewport->WorkSize.x - end_width)) && (io.MousePos.y >= 7 && io.MousePos.y <= titlebar_height)) {
		titlebar_area = true;

		if (io.MouseDownDuration[5] == 0.000000f) {
			// started dragging
			dragging_window = true;
			init_mouse_x = io.MousePos.x;
			init_mouse_y = io.MousePos.y;
		}

		if (io.MouseDownDuration[5] == -1.000000f) {
			// stopped dragging
			dragging_window = false;
		}
	}
	else {
		titlebar_area = false;
		//dragging_window = false;
	}

	if (dragging_window) {
		temp_window_x += io.MousePos.x - init_mouse_x;
		temp_window_y += io.MousePos.y - init_mouse_y;
		SetWindowPos(hwnd, NULL, temp_window_x, temp_window_y, viewport->WorkSize.x, viewport->WorkSize.y, NULL);
	}

	ImGui::SetNextWindowPos(viewport->WorkPos);
	ImGui::SetNextWindowSize(ImVec2{ viewport->WorkSize.x, (float)titlebar_height });
	ImGui::PushStyleVar(ImGuiStyleVar_WindowBorderSize, 0.0f);
	ImGui::PushStyleVar(ImGuiStyleVar_WindowMinSize, ImVec2{ 0.0f, 0.0f });
	// Properly center the content accoring to the titlebar height
	ImGui::PushStyleVar(ImGuiStyleVar_WindowPadding, ImVec2{ 0, 0 });
	ImGui::PushStyleColor(ImGuiCol_WindowBg, ImVec4{ 0.01f, 0.01f, 0.01f, 1.0f });
	ImGui::Begin("window-frame-titlebar", nullptr, titlebar_flags);
	ImGui::PopStyleColor(1);
	ImGui::SetCursorPosX(titlebar_height / 3);
	ImGui::SetCursorPosY(titlebar_height / 6);
	ImGui::TextColored(ImVec4{ 1.0f,1.0f,1.0f,1.0f }, "Application Title");
	ImGui::SameLine();
	ImGui::PushStyleVar(ImGuiStyleVar_ItemSpacing, ImVec2{ 2, 0 });
	ImGui::PushStyleColor(ImGuiCol_Button, ImVec4{ 0, 0, 0, 0 });
	ImGui::PushStyleColor(ImGuiCol_ButtonHovered, ImVec4{ 0.1f, 0.1f, 0.1f, 1.0f });
	ImGui::PushFont(SourceCodePro2);
	ImGui::SetCursorPosY(0);
	ImGui::SetCursorPosX(viewport->WorkSize.x - (end_width - 1));

	if (minimize) {
		ImGui::Button("—", ImVec2{ 30.0f,30.0f });
		ImGui::SameLine();
	}

	if (maximize) {
		ImGui::SetCursorPosY(0);
		ImGui::Button("☐", ImVec2{ 30.0f,30.0f });
		ImGui::SameLine();
	}

	if (close) {
		ImGui::SetCursorPosY(0);
		ImGui::PushStyleColor(ImGuiCol_ButtonActive, ImVec4{ 1.0f, 0.0f, 0.0f, 1.0f });
		ImGui::Button("X", ImVec2{ 30.0f,30.0f });
	}

	ImGui::End();
	ImGui::PopStyleVar(99);
	ImGui::PopStyleColor(99);
	ImGui::PopFont();
}
